import React from 'react'
import "./Department.css"
import { useEffect } from 'react';
import { getAllDepartment } from '../api/Department_API';




function Department() {
    let dep = {};

    useEffect(()=>{
        getAllDepartment().then(resp=>{
            dep = resp.data;
        })
    },[])
  return (
    <div className='department-table'>
    <table>
  <tr>
    <th>S.No.</th>
    <th>Department</th>
  </tr>

  {dep.map=(d)=>{
       return( <tr>
        <td>d.depId</td>
        <td>d.depName</td>
        
      </tr>)
  }}
  
  
</table>
    </div>
  )
}

export default Department
